package leetcode.string;

import java.util.ArrayList;
import java.util.Arrays;
import java.util.HashMap;
import java.util.HashSet;

public class MinimumWindowSubstring2 {

    public String minWindow(String S, String T) {
        if (S == null || T == null || S.length() == 0 || T.length() == 0 || S.length() < T.length())
            return "";

        if (S.length() == T.length()) {
            return sort(S).equals(sort(T)) ? S : "";
        }
        //        T = sort(T);
        // generate wholeLetters and notFound
        HashSet<Character> wholeLetters = new HashSet<Character>();
        HashMap<Character, Integer> notFound = new HashMap<Character, Integer>();
        //        HashSet<Integer> usedIndex = new HashSet<Integer>();
        HashMap<Character, ArrayList<Integer>> index = new HashMap<Character, ArrayList<Integer>>();
        for (int i = 0; i < T.length(); i++) {
            char c = T.charAt(i);
            wholeLetters.add(c);
            if (notFound.containsKey(c))
                notFound.put(c, notFound.get(c) + 1);
            else
                notFound.put(c, 1);
        }
        int start = 0;
        for (; start < S.length(); start++) {
            if (wholeLetters.contains(S.charAt(start)))
                break;
        }
        int end = S.length() - 1;
        for (; end >= 0; end--) {
            if (wholeLetters.contains(S.charAt(end)))
                break;
        }
        if (start > end)
            return "";
        S = S.substring(start, end + 1);

        int leftIndex = -1;
        char leftChar = ' ';
        int rightIndex = -1;
        String minWindow = "";
        for (int i = 0; i < S.length(); i++) {
            //            if(usedIndex.contains(i))
            //                continue;
            char c = S.charAt(i);
            if (wholeLetters.contains(c)) {
                if (notFound.containsKey(c)) {
                    // process index
                    ArrayList<Integer> value = null;
                    if (index.containsKey(c))
                        value = index.get(c);
                    else {
                        value = new ArrayList<Integer>();
                        index.put(c, value);
                    }
                    value.add(i);
                    // process notFound
                    //                    usedIndex.add(i);
                    int remain = notFound.get(c) - 1;
                    if (remain == 0)
                        notFound.remove(c);
                    else
                        notFound.put(c, remain);
                    if (leftIndex == -1) {
                        leftIndex = i;
                        leftChar = c;
                    }
                } else {
                    // process index
                    index.get(c).remove(0);
                    index.get(c).add(i);
                    // if leftChar
                    if (c == leftChar) {
                        leftIndex++;
                        while (leftIndex <= i) {
                            leftChar = S.charAt(leftIndex);
                            if (wholeLetters.contains(leftChar) && index.containsKey(leftChar)
                                    && index.get(leftChar).contains(leftIndex))
                                break;
                            leftIndex++;
                        }
                    }
                }
            }

            if (notFound.isEmpty()) {
                if (minWindow == "") {
                    minWindow = S.substring(leftIndex, i + 1);
                    rightIndex = i;
                } else {
                    if (i > rightIndex)
                        rightIndex = i;
                    int windowLength = rightIndex - leftIndex + 1;
                    if (windowLength < minWindow.length())
                        minWindow = S.substring(leftIndex, rightIndex + 1);
                }
                notFound.put(S.charAt(leftIndex), 1);
                index.get(leftChar).remove(0);
                if (index.get(leftChar).isEmpty())
                    index.remove(leftChar);
                // find new leftIndex
                leftIndex++;
                while (leftIndex <= rightIndex) {
                    leftChar = S.charAt(leftIndex);
                    if (wholeLetters.contains(leftChar) && index.containsKey(leftChar)
                            && index.get(leftChar).contains(leftIndex))
                        break;
                    leftIndex++;
                }
            }
        }
        return minWindow;
    }

    public String sort(String original) {
        char[] chars = original.toCharArray();
        Arrays.sort(chars);
        String sorted = new String(chars);
        return sorted;
    }

    public static void main(String[] args) {
        MinimumWindowSubstring2 mws = new MinimumWindowSubstring2();
        String S = "";
        String T = "";
        System.out.println(mws.minWindow(S, T));
    }
}
